import React from 'react';
import { Grid } from '@mui/material';

import Details from './components/Details/Details';
import Main from './components/Main/Main';

function App() {
 const styles = {
    grid: {
      height: '100vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
    },
    mobile: {
      order: 2,
      '@media (min-width: 600px)': {
        order: 1,
      },
    },
    main: {
      order: 1,
    },
    desktop: {
      order: 3,
      '@media (min-width: 600px)': {
        order: 2,
      },
    },
    last: {
      order: 4,
    },
  };

  return (
    <div>
      <Grid container spacing={2} style={styles.grid}>
        <Grid item xs={12} sm={3} style={styles.mobile}>
          <Details title="Income" />
        </Grid>

        <Grid item xs={12} sm={3} style={styles.main}>
          <Main title="Main" />
        </Grid>

        <Grid item xs={12} sm={3} style={styles.desktop}>
          <Details title="Income" />
        </Grid>

        <Grid item xs={12} sm={3} style={styles.last}>
          <Details title="Expense" />
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
